class User{
    
    var firstName: String
    var initials: String
    var lastName: String
    var city: String
    var state: String
    var age: Double
    init(firstName:String,initials:String,lastName:String,city:String,state:String,age:Double){
        self.age = age
        self.firstName = firstName
        self.initials = initials
        self.lastName = lastName
        self.city = city
        self.state = state
    }
    
}

var users=[User]()

for str in userList1{
    
    var strSplit = str.componentsSeparatedByString(",")
    users += [User(firstName: strSplit[0], initials: strSplit[1], lastName: strSplit[2], city: strSplit[4], state: strSplit[5], age: Double(strSplit[3])!)]
}




var userList=[User]()

for str1 in userList2{
    
    var strSplit1 = str1.componentsSeparatedByString(",")
    userList += [User(firstName: strSplit1[0], initials: strSplit1[1], lastName: strSplit1[2], city: strSplit1[4], state: strSplit1[5], age: Double(strSplit1[3])!)]
    
}



func comp(eUser1:User, eUser2:User) -> Bool {
    return
        eUser1.firstName == eUser2.firstName &&
       eUser1.initials == eUser2.initials &&
        eUser1.age == eUser2.age &&
        eUser1.lastName == eUser2.lastName &&
            eUser1.city == eUser2.city &&
            eUser1.state == eUser2.state
}


var similarUsers = [User]()

for eU1 in users{
    for eU2 in userList{
        if(comp(eU1,eUser2:eU2)){
          
            similarUsers += [eU1]
        }
    }
}

let srt = similarUsers.sort { (x, y) -> Bool in
    return x.age > y.age
}

